import React from 'react';
import logo from './logo.svg';
import './App.css';


function App() {
  return (
    <div className="App">
      <div className="container">
      <form>
          <div className="row">
          <div className="form-group col-md-3">
            <label for="nama">Nama</label>
            <input type="text" id="nama" name="nama" className="form-control" />
          </div> 
          </div>

        </form>
      </div>        
    </div>
  );
}

export default App;
